import {
  Theme,
  createStyles
} from "@material-ui/core/styles";

const styles = (theme: Theme) => createStyles({
  activityContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  activityTitle: {
    fontWeight: 'bold'
  },
  btnAdd: {
    textTransform: 'capitalize',
    letterSpacing: '0.1em'
  }
})

export default styles
